          "title": "Black Adam - Official Trailer 2",
          "description": "There are heroes, there are villains and there is #BlackAdam Only in theaters October 21.\n\nTHE WORLD NEEDED A HERO‚Ä¶ IT GOT BLACK ADAM\n\nFrom New Line Cinema, Dwayne Johnson stars in the action adventure ‚ÄúBlack Adam.‚Äù The first-ever feature film to explore the story of the DC Super Hero comes to the big screen under the direction of Jaume Collet-Serra (‚ÄúJungle Cruise‚Äù).\n\nIn ancient Kahndaq, Teth Adam was bestowed the almighty powers of the gods. After using these powers for vengeance, he was imprisoned, becoming Black Adam. Nearly 5,000 years have passed and Black Adam has gone from man, to myth, to legend. Now released, his unique form of justice, born out of rage, is challenged by modern day heroes who form the Justice Society: Hawkman, Dr. Fate, Atom Smasher and Cyclone.\n\nJohnson stars alongside Aldis Hodge (‚ÄúCity on a Hill,‚Äù ‚ÄúOne Night in Miami‚Äù) as Hawkman, Noah Centineo (‚ÄúTo All the Boys I‚Äôve Loved Before‚Äù) as Atom Smasher, Sarah Shahi (‚ÄúSex/Life,‚Äù ‚ÄúRush Hour 3‚Äù), Marwan Kenzari (‚ÄúMurder on the Orient Express,‚Äù ‚ÄúThe Mummy‚Äù), Quintessa Swindell (‚ÄúVoyagers,‚Äù ‚ÄúTrinkets‚Äù) as Cyclone, Mo Amer (‚ÄúMo,‚Äù ‚ÄúRamy‚Äù), Bodhi Sabongui (‚ÄúA Million Little Things‚Äù), and Pierce Brosnan (the ‚ÄúMamma Mia!‚Äù and James Bond franchises) as Dr. Fate.\n\nCollet-Serra directed from a screenplay written by Adam Sztykiel and Rory Haines & Sohrab Noshirvani, based on characters from DC, based on characters created by Bill Parker and C.C. Beck. The film‚Äôs producers are Beau Flynn, Hiram Garcia, Dwayne Johnson and Dany Garcia, with Toby Emmerich, Richard Brener, Dave Neustadter, Chris Pan, Walter Hamada, Adam Schlagman, Geoff Johns, Eric McLeod and Scott Sheldon executive producing.\n\nThe director‚Äôs behind-the-scenes creative team includes Oscar-nominated director of \nphotography Lawrence Sher (‚ÄúJoker‚Äù), production designer Tom Meyer (‚ÄúReal Steel‚Äù), editors Mike Sale (‚ÄúRed Notice,‚Äù ‚ÄúSkyscraper‚Äù) and John Lee (‚ÄúAnyone Home?‚Äù), costume designers Kurt and Bart (‚ÄúDeadpool 2,‚Äù ‚ÄúThe Hunger Games: Mockingjay ‚Äì Part 1 & 2‚Äù), Oscar-winning visual effects supervisor Bill Westenhofer (‚ÄúLife of Pi,‚Äù ‚ÄúWonder Woman‚Äù), and composer Lorne Balfe (‚ÄúBlack Widow‚Äù).\n\nNew Line Cinema Presents a Seven Bucks/Flynn Co. Production, A Jaume Collet-Serra Film, ‚ÄúBlack Adam,‚Äù smashing into theaters and IMAX internationally beginning 19 October 2022, in North America on October 21, 2022. It will be distributed worldwide by Warner Bros. Pictures."
